y class=\"<r:langcode /> <r:if_url matches=\"^/$\">home</r:if_url><r:unless_url matches=\"^/$\"><r:slug /></r:unless_url>\">\r\n\r\n    <div class=\"wrap clearfix\">\r\n      <div id=\"header\" class=\"clearfix\">\r\n        <r:snippet name=\"header\" />\r\n      </div>\r\n      <hr />\r\n      <div id=\"content\" class=\"clearfix\">\r\n        <r:if_content part=\"breadcrumb\" inherit=\"true\">\r\n        <div id=\"breadcrumb\">\r\n          <r:content part=\"breadcrumb\" inherit=\"true\" />\r\n        </div>\r\n        </r:if_content>\r\n        <div id=\"content_main\" class=\"span-16 colborder clearfix\">\r\n          <h1><r:title/></h1>\r\n          <r:content part=\"pre-body\" inherit=\"true\" />\r\n          <r:unless_content part=\"lees-meer\">\r\n            <r:content />\r\n          </r:unless_content>\r\n          <r:content part=\"lees-meer\" inherit=\"true\" />\r\n          <r:content part=\"post-body\" inherit=\"true\" />\r\n        </div>\r\n        <r:if_content part=\"nav-sec, content-sec\" inherit=\"true\" find=\"any\">\r\n        <div id=\"content_sec\" class=\"span-7 last clearfix\">\r\n          <r:content part=\"nav-sec\" inherit=\"true\" />\r\n          <r:content part=\"content-sec\" inherit=\"true\" />\r\n        </div>\r\n        </r:if_content>\r\n      </div>\r\n      <hr />\r\n      <div id=\"footer\" class=\"clearfix\">\r\n        <r:snippet name=\"footer\" />\r\n      </div>\r\n    </div>\r\n  </body>\r\n</html>\r\n','2007-10-20 18:07:38','2008-11-10 12:42:36',1,1,'',55),(2,'Placeholder','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"<r:langcode/>\" lang=\"<r:langcode/>\">\r\n<head>\r\n\r\n    <link rel=\"shortcut icon\" href=\"/favicon.ico\" type=\"image/x-icon\" />\r\n\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"/>\r\n	<title>Hier komt binnenkort een website van Gorilla webdesign.</title>\r\n	<!-- Stylesheets -->\r\n	<link rel=\"stylesheet\" type=\"text/css\" href=\"/stylesheets/placeholder.css\" />\r\n	<!--[if IE]>\r\n		<script src=\"/javascripts/IE7/ie7-standard-p.js\" type=\"text/javascript\"></script>\r\n		<link href=\"/stylesheets/ie.css\" media=\"screen\" rel=\"Stylesheet\" type=\"text/css\" />\r\n	<![endif]-->\r\n</head>\r\n\r\n<body id=\"gorillacms\" class=\"home\">\r\n	<div id=\"wrap\">\r\n    <div id=\"header\">\r\n      	<h1><a href=\"/\">Gorilla webdesign</a></h1>\r\n    </div>\r\n		<hr />\r\n		<div id=\"content\">\r\n			<div id=\"content-main\">\r\n			  	<h2>Hier komt binnenkort een website van Gorilla webdesign.</h2>\r\n        		<p>Gorilla Webdesign bouwt elegante &amp; overzichtelijke websites \r\n					volgens de webstandaarden. Daardoor scoort uw site beter bij de zoekrobots\r\n					en is hij sneller te updaten. \r\n					<a href=\"http://www.gorilla-webdesign.be\">Lees meer</a></p> \r\n			</div>\r\n		</div>\r\n	  <hr />\r\n	  <div id=\"footer\">\r\n      <p class=\"adres\">Gorilla webdesign bvba.<br />\r\n      Kwatrechtsteenweg 150<br />\r\n      9230 Wetteren</p>\r\n      <p>Tel: 09 369 16 00<br />\r\n      Fax: 09 369 35 00</p>\r\n      <p><a href=\"mailto:info@gorilla-webdesign.be\">info@gorilla-webdesign.be</a><br />\r\n      <a href=\"http://www.gorilla-webdesign.be\">www.gorilla-webdesign.be</a></p>\r\n	  </div>\r\n	</div>\r\n</body>\r\n</html>','2008-06-05 19:57:05','2008-06-05 19:57:05',1,NULL,'',0),(4,'Empty','<r:content />','2008-10-27 01:00:22','2008-10-27 01:00:22',1,NULL,'',0),(5,'Master','<r:if_dev>\r\n  <r:inside_layout name=\"normal\"><r:content_for_layout/></r:inside_layout>\r\n</r:if_dev>\r\n<r:unless_dev>\r\n  <r:inside_layout name=\"placeholder\"><r:content_for_layout/></r:inside_layout>\r\n</r:unless_dev>','2008-10-27 01:00:47','2008-10-27 01:00:47',1,NULL,'',0),(6,'XML','<r:content />','2008-10-29 11:34:53','2008-10-29 11:34:53',1,NULL,'text/xml',0);
