INSERT INTO `page_parts` VALUES (1,'body','WymEditor','<br />',1),(2,'body','Textile','<h2>Oeps, pagina kan niet worden gevonden (Error 404)</h2>\n<p>De pagina die je zoekt kan niet worden gevonden.</p>\n<p>Misschien werd de pagina gewist of verplaatst, of werd je doorverwezen via een oude link.</p>\n\n<h3>En nu?</h3>\n<p>Contacteer <a href=\"mailto:info@gorilla-webdesign.be\">de webmaster</a> om deze fout te melden, of <a href=\"/\">bezoek de homepagina</a></p>\n',2),(4,'body','','<p>Gebruik onderstaand formulier om uw vragen te stellen of suggesties te doen. We beantwoorden uw vragen zo snel mogelijk.</p>\r\n<div class=\"form\">\r\n  <r:mailer:form name=\"contact\">\r\n  <fieldset class=\"first\">\r\n    <h3>Uw gegevens:</h3>\r\n    <ul>\r\n      <li>\r\n        <label for=\"naam\">Naam<abbr title=\"required\">*</abbr></label>\r\n        <r:mailer:text name=\"naam\" required=\"true\" title=\"Vul uw naam in\" />\r\n      </li>\r\n      <li>\r\n        <label for=\"email\">Email<abbr title=\"required\">*</abbr></label>\r\n        <r:mailer:text name=\"email\" required=\"true validate-email\" title=\"Een geldig mail adres is verplicht\" />\r\n      </li>\r\n      <li>\r\n        <label for=\"straat\">Straat + nr</label>\r\n        <r:mailer:text name=\"straat\" />\r\n      </li>\r\n      <li>\r\n        <label for=\"gemeente\">Postcode + gemeente</label>\r\n        <r:mailer:text name=\"gemeente\" />\r\n      </li>\r\n      <li>\r\n        <label for=\"tel\">Telefoon</label>\r\n        <r:mailer:text name=\"tel\" />\r\n      </li>\r\n      <li>\r\n        <label for=\"bericht\">Bericht<abbr title=\"required\">*</abbr></label>\r\n        <r:mailer:textarea name=\"bericht\" required=\"true\" title=\"Een vraag of opmerking is verplicht\" />\r\n      </li>\r\n    </ul>\r\n  </fieldset>\r\n    <fieldset class=\"radio\">\r\n      <h3>U bent</h3>\r\n      <ul>\r\n        <li>\r\n          <label for=\"particulier\"><input type=\"radio\" name=\"mailer[part_bedrijf]\" checked=\"checked\" id=\"particulier\" value=\"particulier\" />Particulier</label>\r\n        </li>\r\n        <li>\r\n          <label for=\"bedrijf\"><input type=\"radio\" name=\"mailer[part_bedrijf]\" id=\"bedrijf\" value=\"bedrijf\" />Bedrijf</label>\r\n        </li>\r\n      </ul>\r\n  </fieldset>\r\n  <fieldset class=\"checkbox\">\r\n    <ul><li>\r\n      <label for=\"send_to_maillist\">\r\n      <r:mailer:checkbox name=\"send_to_maillist\" /> Ja ik wens in te schrijven op de nieuwsbrief</label>\r\n    </li></ul>\r\n  </fieldset>\r\n  <fieldset>\r\n    <ul><li>\r\n       <button type=\"submit\" id=\"verzenden\">Verzenden</button>\r\n    </li></ul>\r\n  </fieldset>\r\n  </r:mailer:form>\r\n</div>',4),(6,'email','','<r:mailer:get name=\"naam\"/> (<r:mailer:get name=\"email\"/>, <r:mailer:get name=\"tel\"/>) stelde net volgende vraag via de website:\r\n<r:mailer:get name=\"bericht\"/>',4),(9,'body','','<div id=\"nieuws_overzicht\">\r\n  <r:children:each order=\"desc\" limit=\"4\">\r\n    <div class=\"entry\">\r\n      <h2><r:link /></h2>\r\n      <p class=\"posted\"><span class=\"date\"><r:date format=\"%d/%m/%Y\" /></span> <span class=\"by\"><r:author /></span>\r\n      <span class=\"comments\"><r:link><r:comments:count /> reacties</r:link></span>\r\n      </p>\r\n      <r:content part=\"body\"/>\r\n      <r:if_content part=\"lees-meer\"><p class=\"read_more\"><r:link>Lees meer...</r:link></p></r:if_content>\r\n    </div>\r\n  </r:children:each>\r\n</div>',6),(10,'body','WymEditor','<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do\r\neiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad\r\nminim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip\r\nex ea commodo consequat. </p>',7),(12,'pre-body','','<r:unless_url matches=\"^/nieuws/recent(\\/)?$\">\r\n<ul class=\"nav_news clearfix\">\r\n  <r:previous><li class=\"previous\"><r:link>Vorig bericht</r:link></li></r:previous>\r\n  <r:next><li class=\"next\"><r:link>Volgend bericht</r:link></li></r:next>\r\n</ul>\r\n<h1><r:title /></h1>\r\n</r:unless_url>',6),(13,'post-body','','<r:unless_url matches=\"^/nieuws/recent(\\/)?$\">\r\n<p class=\"posted\">\r\n  <span class=\"date\"><r:date format=\"%d/%m/%Y\" /></span> <span class=\"by\"><r:author /></span>\r\n</p>\r\n</r:unless_url>\r\n\r\n<r:snippet name=\"comments\" />',6),(15,'lees-meer','WymEditor','<p>Duis aute irure dolor in reprehenderit\r\nin voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui\r\nofficia deserunt mollit anim id</p><p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do\r\neiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad\r\nminim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip\r\nex ea commodo consequat. </p><p>Duis aute irure dolor in reprehenderit\r\nin voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui\r\nofficia deserunt mollit anim idLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do\r\neiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad\r\nminim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip\r\nex ea commodo consequat.</p>',7),(17,'body','WymEditor','<p>Bedankt voor je reactie</p>',9),(18,'nav-sec','','<r:nav id=\"nav_news\" root=\"/nieuws\" />\r\n\r\n<p><a class=\"rss\" href=\"/nieuws/rss\">Nieuws RSS feed</a></p>\r\n\r\n<r:unless_url matches=\"/nieuws/recent(\\/)$\">\r\n<ul class=\"prevnext clearfix\">\r\n <r:previous><li class=\"previous\"><h4><span>&#8592;</span> Vorig bericht:</h4> <r:link/></li></r:previous>\r\n <r:next><li class=\"next\"><h4><span>&#8594;</span> Volgend bericht:</h4> <r:link/></li></r:next>\r\n</ul>\r\n</r:unless_url>\r\n\r\n<p class=\"archief\"><a href=\"/nieuws/archief\">Archief</a></p>\r\n\r\n<h3>Per categorie</h3>\r\n<r:tag_cloud />',10),(19,'body','','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<rss version=\"2.0\" xmlns:dc=\"http://purl.org/dc/elements/1.1/\">\r\n  <channel>\r\n    <title>RSS Feed</title>\r\n    <link>http://update.me<r:url /></link>\r\n    <language>nl-BE</language>\r\n    <ttl>40</ttl>\r\n    <description>Updateme RSS feed.</description>\r\n    <r:find url=\"/nieuws/recent/\">\r\n    <r:children:each limit=\"10\">\r\n        <item>\r\n          <title><r:title /></title>\r\n          <description><r:escape_html><r:content /></r:escape_html></description>\r\n          <pubDate><r:rfc1123_date /></pubDate>\r\n          <guid>http://update.me<r:url /></guid>\r\n          <link>http://update.me<r:url /></link>\r\n        </item>\r\n    </r:children:each>\r\n    </r:find>\r\n  </channel>\r\n</rss>',11),(21,'mailer','','subject: Vraag via de website\r\nfrom_field: email\r\nredirect_to: /contact/bedankt\r\nrecipients:\r\n  - benny@gorilla-webdesign.be\r\n\r\n',4),(22,'body','WymEditor','<p>In order to allay some of the myths surrounding typography on the web,\r\nI have structured this website to step through Bringhurstâ€™s working\r\nprinciples, explaining how to accomplish each using techniques\r\navailable in <abbr title=\"HyperText Mark-up Language\">HTML</abbr> and <abbr title=\"Cascading Style Sheets\">CSS</abbr>. The future is considered with coverage of <abbr>CSS3</abbr>, and practicality is ever present with workarounds, alternatives and compromises for less able&#160;browsers.</p><p>At the time of writing, this is a work in progress. I am adding to\r\nthe site in the order presented in Bringhurstâ€™s book, one principle at\r\na time. You can subscribe to an <a href=\"#\"><abbr title=\"Rich Site Summary\">RSS</abbr>&nbsp;feed</a> for notification of new&nbsp;additions.</p>',13),(23,'post-body','','<r:gallery id=\"2\">\r\n <r:gallery:lightbox image_width=\"600\" image_height=\"400\" thumb_height=\"90\" thumb_width=\"90\" />\r\n</r:gallery>',13),(24,'body','','',14),(25,'body','WymEditor','<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat. Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat</p><p>Ma quande lingues coalesce, li grammatica del resultant lingue es plu simplic e regulari quam ti del coalescent lingues. Li nov lingua franca va esser plu simplic e regulari quam li existent Europan lingues. It va esser tam simplic quam Occidental: in fact, it va esser Occidental. A un Angleso it va semblar un simplificat Angles, quam un skeptic Cambridge amico dit me que Occidental es. Ma quande lingues coalesce, li grammatica del resultant lingue es plu simplic e regulari quam ti del coalescent lingues. Li nov lingua franca va esser plu simplic e regulari quam li existent Europan lingues. It va esser tam simplic quam.</p>',15),(26,'body','WymEditor','<p>Epsum factorial non deposit quid pro quo hic escorol. Olypian quarrels et gorilla congolium sic ad nauseum. Souvlaki ignitus carborundum e pluribus unum. Defacto lingo est igpay atinlay. Marquee selectus non provisio incongruous feline nolo contendre. Gratuitous octopus niacin, sodium glutimate. Quote meon an estimate et non interruptus stadium. Sic tempus fugit esperanto hiccup estrogen. Glorious baklava ex librus hup hey ad infinitum. Non sequitur condominium facile et geranium incognito. Epsum factorial non deposit quid pro quo hic escorol. Marquee selectus non provisio incongruous feline nolo contendre Olypian quarrels.</p><p>Epsum factorial non deposit quid pro quo hic escorol. Olypian quarrels et gorilla congolium sic ad nauseum. Souvlaki ignitus carborundum e pluribus unum. Defacto lingo est igpay atinlay. Marquee selectus non provisio incongruous feline nolo contendre. Gratuitous octopus niacin, sodium glutimate. Quote meon an estimate et non interruptus stadium. Sic tempus fugit esperanto hiccup estrogen. Glorious baklava ex librus hup hey ad infinitum. Non sequitur condominium facile et geranium incognito. Epsum factorial non deposit quid pro quo hic escorol. Marquee selectus non provisio incongruous feline nolo contendre Olypian quarrels.</p>',16),(27,'body','WymEditor','<p>Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc., li tot Europa usa li sam vocabularium. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules. Omnicos directe al desirabilit. De un nov lingua franca: on refusa continuar payar custosi traductores. It solmen va esser necessi far uniform grammatica, pronunciation e plu sommun paroles. Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc., li tot Europa usa li sam vocabularium. Li lingues differe solmen in li grammatic.</p><p>Li Europan lingues es membres del sam familie. Lor separat existentie\r\nes un myth. Por scientie, musica, sport etc., li tot Europa usa li sam\r\nvocabularium. Li lingues differe solmen in li grammatica, li\r\npronunciation e li plu commun vocabules. Omnicos directe al\r\ndesirabilit. De un nov lingua franca: on refusa continuar payar custosi\r\ntraductores. It solmen va esser necessi far uniform grammatica,\r\npronunciation e plu sommun paroles. Li Europan lingues es membres del\r\nsam familie. Lor separat existentie es un myth. Por scientie, musica,\r\nsport etc., li tot Europa usa li sam vocabularium. Li lingues differe\r\nsolmen in li grammatic.</p>',17),(28,'body','WymEditor','<p>Epsum factorial non deposit quid pro quo hic escorol. Olypian quarrels et gorilla congolium sic ad nauseum. Souvlaki ignitus carborundum e pluribus unum. Defacto lingo est igpay atinlay. Marquee selectus non provisio incongruous feline nolo contendre. Gratuitous octopus niacin, sodium glutimate. Quote meon an estimate et non interruptus stadium. Sic 