INSERT INTO `snippets` VALUES (1,'header','','<p id=\"skip-to-content\"><a href=\"#content\">â†“ Direct naar inhoud</a></p>\r\n<r:sitelanguages:nav />\r\n<p id=\"logo\"><a href=\"/\">Gorilla CMS</a></p>\r\n<div id=\"navigation\">\r\n  <r:nav id=\"nav_main\" />\r\n</div>','2007-10-20 18:07:37','2008-10-31 09:25:59',1,1,7),(2,'footer','','<p>Bedrijf <span class=\"hyphen\">-</span> Bedrijvenstraat <span class=\"hyphen\">-</span> 1234 Gemeente <span class=\"hyphen\">-</span> BelgiÃ«<br />\r\nT +32 (0)9 123 45 67 <span class=\"hyphen\">-</span> F +32 (0)9 123 45 66 <span class=\"hyphen\">-</span>\r\n <a title=\"\" href=\"mailto:info@bedrijf.be\">info@bedrijf.be</a>\r\n</p>\r\n<p id=\"site_info\"><span id=\"gorilla\"><a href=\"http://www.gorilla-webdesign.be\" \r\n  title=\"Gorilla webdesign, Websites gebaseerd op webstandaarden\">webdesign by Gorilla</a></span>\r\n</p>\r\n','2007-10-20 18:07:37','2008-08-01 18:24:38',1,1,7),(3,'comments','','<r:if_comments>\r\n  <h2>Reacties</h2>\r\n  <div id=\"comments\">\r\n  <r:comments:each>\r\n    <r:snippet name=\"comment\" />\r\n  </r:comments:each>\r\n  </div>\r\n</r:if_comments>\r\n<r:snippet name=\"comment_form\" />','2007-11-22 17:17:10','2008-10-27 01:04:44',NULL,1,2),(4,'comment','','<r:comments:field>\r\n<div class=\"comment clearfix <r:cycle values=\"odd, even\" />\">\r\n  <span class=\"number\"><r:index />.</span>\r\n  <span class=\"by_line\">\r\n    <r:author_link /> schreef:\r\n  </span>\r\n  <div class=\"message\">\r\n    <r:content_html />\r\n  </div>\r\n</div>\r\n</r:comments:field>','2007-11-22 17:17:10','2008-10-27 01:05:18',NULL,1,2),(5,'comment_form','','<r:if_comments_enabled>\r\n  <div class=\"commentform form\">\r\n  <r:comments:form>\r\n    <h2>Laat een reactie achter</h2>\r\n    <fieldset>\r\n      <ul>\r\n        <li>\r\n          <label for=\"comment_author\">Naam</label><br />\r\n          <r:text_field_tag name=\"author\" id=\"author\" class=\"required\" />\r\n          <r:error on=\"author\"><span class=\"validation-advice\">Naam <r:message /></span></r:error>\r\n        </li>\r\n        <li>\r\n          <label for=\"comment_author_email\">Email</label><br />\r\n          <r:text_field_tag name=\"author_email\" class=\"required\" />\r\n          <span class=\"note\">(verplicht, maar wordt niet vrijgegeven)</span>\r\n          <r:error on=\"author_email\"><span class=\"validation-advice\">Email <r:message /></span></r:error>\r\n        </li>\r\n        <li>\r\n          <label for=\"comment_author_url\">Website</label><br />\r\n          <r:text_field_tag name=\"author_url\" />\r\n        </li>\r\n        <li>\r\n          <label for=\"comment_content\">Bericht</label><br />\r\n          <r:text_area_tag name=\"content\" class=\"required\" rows=\"9\" cols=\"40\" />\r\n          <r:error on=\"content\"><span class=\"validation-advice\">Bericht <r:message /></span></r:error>\r\n        </li>\r\n      </ul>\r\n      <input type=\"hidden\" name=\"comment[filter_id]\" value=\"Textile\" />\r\n    </fieldset>\r\n    <fieldset class=\"submit\">\r\n      <p><button type=\"submit\">Verzenden</button></p>\r\n    </fieldset>\r\n  </r:comments:form>\r\n  </div>\r\n</r:if_comments_enabled>','2007-11-22 17:17:10','2008-10-27 01:04:14',NULL,1,7);
